import React, { useState } from 'react';

import Chatty from '../../Pages/Chatty';

const Info = props => {

    const upper = (e) => {
        e.preventDefault()
        setAge(age + 2)
    }

    const nameHandler = e => {
        e.preventDefault()
        setName(e.target.value)
    }

    const changy = e => {
        e.preventDefault()
        setName(e.target.value)
    }

    //Database Stuff here
    const [name, setName] = useState('Dan');
    const [age, setAge] = useState(0);
    const [job, setJob] = useState('Coder');
    const [count, setCount] = useState('0');
    const [message, setMessage] = useState('Love you');

    return (
    //Send down the info, render the chat shit
            <Chatty 
                name={name}
                age={age}
                changy={changy}
                nameHandler={nameHandler}
                setAge={setAge}
                upper={upper}
                job={job}
                count={count}
                setCount={setCount}
                message={message}
            />
    )
}

export default Info;
